				String ticketId = UUID.randomUUID().toString(); //认证ID, 由使用方指定, 发起不同的认证任务需要更换不同的认证ID
				String token = null; //认证token, 表达一次认证会话
				int statusCode = -1; //-1 未认证, 0 认证中, 1 认证通过, 2 认证不通过
